import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import AOS from "aos";
import "aos/dist/aos.css";
import 'features/setting/style/Setting.scss'
import { UserModify } from 'features/user';
import CommentList from 'features/board/containers/CommentList';
import { QnA } from 'features/setting/components/QnACreate';

const setting = () => {

    useEffect(() => {
        AOS.init({
            duration : 3000
        });
    });

    return(
        <>
        <div className = "hm">
                <Link className="btn6" data-aos="fade-up" to="/">홈으로 돌아가기</Link><br />
            </div>
          <div className = "sg">
            <div >
                <p data-aos='fade-down'>
                    <p>QnA 등록</p>
                    <QnA/></p>
            </div>
            <div >
                <p data-aos="fade-down">
                    <UserModify/>

                </p>
            </div>

          </div>    
        </>
    )
};

export default setting;
